import styled from "styled-components";
import { Container } from "react-bootstrap";

export const Bigbox = styled(Container)`
  .container,
  .container-fluid,
  .container-lg,
  .container-md,
  .container-sm,
  .container-xl {
    padding: 30px;
  }
  border: 1px solid #c4c4c4;
`;
